BEGIN;

SET client_encoding = 'UTF-8';

DROP SCHEMA IF EXISTS evilcall CASCADE;
CREATE SCHEMA evilcall;


CREATE TABLE evilcall.customer (
  id SERIAL,
  first_name VARCHAR(100) ,
  last_name VARCHAR(100),
  email VARCHAR(50) ,
  PRIMARY KEY (id)
);


CREATE TABLE evilcall.outgoingCall (
  id SERIAL,
  customer_id integer NOT NULL,
  date date NOT NULL,
  time TIME  NOT NULL,
  duration DECIMAL(6,2) NOT NULL,
  number VARCHAR(20) NOT NULL,
  PRIMARY KEY (id)
);

ALTER TABLE evilcall.outgoingCall
  ADD FOREIGN KEY (customer_id)
REFERENCES evilcall.customer (id)
ON DELETE CASCADE;


delete from evilcall.outgoingCall;

DO
$do$
BEGIN
  FOR i IN 1..100000   LOOP
    values (
      floor(random()*(1000)+1),
      NOW() + (random() * (NOW()+'31 days' - NOW())),
      time '00:00' + random() * (time '24:00' - time '00:00') ,
      random() * 60,
      floor(random() * 9999999999 + 1111111111));
  END LOOP;
END
$do$;



COMMIT;

ANALYZE evilcall.customer;
ANALYZE evilcall.outgoingCall;

